import { StatusBar } from "expo-status-bar";
import client from "../api/client";
import React, {useContext} from "react";
import Calendar from './newQueue';
import { Ionicons, Entypo, MaterialIcons, FontAwesome5 } from '@expo/vector-icons';
import {
    StyledContainer,
    InnerContainer,
    PageLogo,
    PageTitle,
} from './../components/styles'
import {View, Text, Alert ,Image,TouchableOpacity, StyleSheet} from 'react-native';
import {UserContext} from '../contexts/userContexts'
import AsyncStorage from "@react-native-async-storage/async-storage";
import { FlatList } from "react-native-gesture-handler";

const SECTIONS = 
    [
      {
        key: '1',
        text: 'Item text 1',
        uri: 'https://www.lady-nails.co.il/wp-content/uploads/2020/06/%D7%9C%D7%A7-%D7%92%D7%9C-12.jpg',
      },
      {
        key: '2',
        text: 'Item text 2',
        uri: 'https://www.lady-nails.co.il/wp-content/uploads/2020/11/nails5.jpg',
      },

      {
        key: '3',
        text: 'Item text 3',
        uri: 'https://biosculpture.co.il/wp-content/uploads/2021/03/%D7%9E%D7%95%D7%A1%D7%9C%D7%9E%D7%99%D7%95%D7%AA-%D7%9C%D7%A7-%D7%92%D7%9C.jpg',
      },
      {
        key: '4',
        text: 'Item text 4',
        uri: 'https://www.lady-nails.co.il/wp-content/uploads/2020/11/nails2.jpg',
      },
      {
        key: '5',
        text: 'Item text 5',
        uri: 'https://www.lady-nails.co.il/wp-content/uploads/2020/11/nails6.jpg',
      },
    ];

const ListItem = ({ item }) => {
  return (
    <View style={styles.item}>
      <Image
        source={{
          uri: item.uri,
        }}
        style={styles.itemPhoto}
        resizeMode="cover"
      />
      <Text style={styles.itemText}>{item.text}</Text>
    </View>
  );
};

const Welcome = ({navigation}) => {
      const {user, Logout} = useContext(UserContext);

      const logout = async () => {
          try {
              await AsyncStorage.removeItem('token');
              Logout();
              navigation.navigate('Login');
          } catch (e) {
              console.log(e);
          }
    }

    const showAlertSignOut = () => {
        Alert.alert('התנתקות', 
                    'האם את בטוחה שאת רוצה להתנתק?',
                    [{text:'כן', onPress: ()=> logout()},
                    {text:'ביטול'}])
    }

    
    return (
        <StyledContainer>
            <StatusBar style="dark" />
            <InnerContainer>
                <PageLogo resizeMode="cover" source = {require('./../assets/lak.jpeg')}/>
                <PageTitle>נעמה כהן</PageTitle>
                
                <View style={{ height: 250, width: '100%'}}>
                  <Text>העבודות שלי</Text>
                    <FlatList
                      data={SECTIONS}
                      renderItem={({ item }) => <ListItem item={item} />}
                      keyExtractor={item => item.key}
                      showsHorizontalScrollIndicator={false}
                      horizontal
                  />
                </View>
            
    

            </InnerContainer>
              
            <View style={"marginTop: 70"}>
                <Calendar/>
            </View>

            {/* Navigation Bar */}
            <View style={{display: 'flex',justifyContent: 'center', alignContent: 'center'}}>        
                <View style={{display: 'flex', alignItems: 'center'}}>
                    <View style={ styles.menuNavigator }>

                        <TouchableOpacity onPress={() => navigation.navigate("Welcome")}>
                            <Ionicons name="home-outline" size={30} color="black" />
                        </TouchableOpacity>

                        <TouchableOpacity onPress={() => navigation.navigate("MyQueues")}>
                            <MaterialIcons name="playlist-add-check" size={35} color="black" />
                        </TouchableOpacity>

                        <TouchableOpacity onPress={'https://ul.waze.com/ul?ll=31.24937992%2C34.78982806&navigate=yes&utm_campaign=default&utm_source=waze_website&utm_medium=lm_share_location'}>
                            <FontAwesome5 name="waze" size={29} color="black" />
                        </TouchableOpacity>

                        <TouchableOpacity onPress={() => showAlertSignOut()}>
                            <Entypo name="log-out" size={29} color="black" />
                        </TouchableOpacity>

                    </View>
                </View>
            </View>
            {/* Navigation Bar */}
        </StyledContainer>
    );
}



const styles = StyleSheet.create({
  menuNavigator: {
    display: 'flex',
    flexDirection: 'row', 
    justifyContent:'space-between', 
    alignItems:'center', 
    backgroundColor: '#f2f2f2', 
    width: '95%',height:70,
    borderRadius:15,   
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.5,
    shadowRadius: 2,
    elevation: 2,
    paddingHorizontal: 18
  },
  container: {
    flex: 1,
    backgroundColor: '#121212',
  },
  sectionHeader: {
    fontWeight: '800',
    fontSize: 18,
    color: '#f4f4f4',
    marginTop: 20,
    marginBottom: 5,
  },
  item: {
    margin: 10,
  },
  itemPhoto: {
    width: 170,
    height: 220,
    borderTopLeftRadius: 8,
    borderTopRightRadius:8,
    shadowColor: '#000',
  },
  itemText: {
    color: 'rgba(255, 255, 255, 0.5)',
    marginTop: 5,
  },
});

export default Welcome;
